import React, { Component } from 'react';

class Ticker extends Component {
    componentDidMount() {
        fetch('https://jsonplaceholder.typicode.com/users')
            .then(response => response.json())
            .then(json => {
                this.setState({
                    isLoaded: true,
                    items: json
                })
            });
    }

    render() {
        return this.props.todos.map((todo) => (
            <h3>{ todo.title }</h3>
        ));
    }
}

export default Ticker;
